text:
There is an anecdote about a young man (a poet) being berated by an older woman during WWI where she asks him if he is not ashamed of letting all those other young men die to protect their culture, to which he replied something along the lines of<p><pre><code>    Not at all madam, I am the culture they are dying for&quot;
</code></pre>
Does anyone have some info about the origins of this story? The persons involved perhaps (I seem to remember reading one time a text identifying someone as the poet — someone on the caliber of Lytton Strachey, although he would be from an earlier time)
